import { SHOW_ACTIVE, SHOW_ALL, SHOW_COMPLETED } from "./types";

const showActiceActionCreator = () => ({
    type: SHOW_ACTIVE,
    payload: id
})
const showAllActionCreator = () => ({
    type: SHOW_ALL,
    payload: id
})

const showCompletedActionCreator = () => ({
    type: SHOW_COMPLETED,
    payload: id
})


export {
    showActiceActionCreator,
    showAllActionCreator,
    showCompletedActionCreator
}
